import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Contato() {
  return (
    <di className='contato'>
      <Row>
        <Col>
            <h1>Fale conosco</h1>
        </Col>
      </Row>
    </di>
  )
}

export default Contato
